import React from "react";
import "./App.css";
import HeaderComp from "./components/HeaderComponet/Header";
import Crawl from "./components/CrawlComponent/Crawl";
import styled from "styled-components";

const Padding = styled.div`
  padding-top: 50px;
`;
const App = () => {
  return (
    <div>
      <div>
        <HeaderComp />
      </div>
      <div>
        <Padding>
          <Crawl />
        </Padding>
      </div>
    </div>
  );
};

export default App;
